import React from 'react'


const HelpButton = () => {
  return (
    <div>
        <FontAwesomeIcon icon="fa-solid fa-question" />
        <img src="client\public\questionmark.png" alt="" className='bg-white'/>
    </div>
  )
}

export default HelpButton
